import React from 'react';

const facilities = [
  { name: "Facility 1" },
  { name: "Facility 2" },
  { name: "Facility 3" },
  { name: "Facility 4" },
  { name: "Facility 5" },
  { name: "Facility 6" },
  { name: "Facility 7" },
  { name: "Facility 8" }
];

function FacilityGrid() {
  return (
    <div className="mt-8 bg-white p-6 shadow rounded-lg w-full max-w-[1000px]">
      <h3 className="text-lg font-medium text-gray-900 mb-4">All Facilities</h3>
      <ul className="divide-y divide-gray-200">
        {facilities.map((facility, index) => (
          <li key={index} className="flex justify-between items-center py-3">
            <div className="flex items-center">
              <div className="w-10 h-10 rounded-full bg-gray-500 mr-3"></div>
              <span className="text-sm font-medium text-gray-900">{facility.name}</span>
            </div>
            <div className="flex gap-2">
              <button className="px-4 py-2 text-sm bg-indigo-500 text-white rounded-full hover:bg-indigo-600 focus:outline-none">
                Edit
              </button>
              <button className="px-4 py-2 text-sm bg-red-500 text-white rounded-full hover:bg-red-600 focus:outline-none">
                Remove
              </button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default FacilityGrid;
